import React from "react";
import { TextField, Grid, InputAdornment, IconButton } from "@material-ui/core";
import {Visibility} from '@material-ui/icons/Visibility.js';
import {VisibilityOff} from '@material-ui/icons/VisibilityOff.js';

const Input = (props) => {
    return(
        <Grid item xs = {6} sm = {props.half ? 6 : 12}>
            <TextField name={props.name} 
            variant = "outlined" 
            label={props.label} 
            handleChange = {props.handleChange} 
            required
            fullWidth
            autoFocus = {props.autoFocus}
            type={props.type}
            InputProps={props.name === 'password' && {
                endAdornment: (
                    <InputAdornment position="end">
                        <IconButton onClick={props.handleShowPassword}>
                            {(props.type === 'password') ? <Visibility/> : <VisibilityOff/>}
                        </IconButton>
                    </InputAdornment>
                ),
            }}
        />
        </Grid>
    );
}
export default Input;
